      x: dates,
      y: totalInfections,
      type: 'scatter',
      name: 'Infections'
  });
  traces.push({
      x: dates,
      y: totalDeaths,
      type: 'scatter',
      name: 'Deaths'
  });
  var layout = {
    title: {
      text: 'Accumulated Coronavirus cases in Gambia (GM)'
    },
    yaxis: {
      title: {
        text: 'Accumulated number of cases'
      }
    }
  };
  Plotly.newPlot('graph_accu_gm', traces, layout, {
      displaylogo: false,
      modeBarButtonsToRemove: ['sendDataToCloud']
  });
</script>
